import React, { useState } from "react";
import axios from "axios";
import {
  Box,
  Button,
  TextField,
  Typography,
  Paper,
  Container,
} from "@mui/material";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import { Bar } from "react-chartjs-2";

// Register Chart.js components
ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function App() {
  const [isTraining, setIsTraining] = useState(false);
  const [inputText, setInputText] = useState("");
  const [classification, setClassification] = useState(null);
  const [chartData, setChartData] = useState(null);



  const handleTrainClick = async () => {
    setIsTraining(true);
    try {
      console.log("Sending training request...");
      const response = await axios.post("http://localhost:5050/train");
      console.log("Train Response:", response.data);
      alert("Training completed: " + response.data.message);
    } catch (error) {
      console.error("Train Error:", error.response?.data || error.message);
      alert("Training failed. Check the backend logs.");
    } finally {
      setIsTraining(false);
    }
  };

  const handleTestSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post("http://localhost:5050/test", {
        input: inputText,
      });
      setClassification(response.data.classification);
      setChartData(response.data.activations);
    } catch (error) {
      console.error("Error during testing:", error);
      alert("Testing failed.");
    }
  };

  return (
    <Container maxWidth="lg" style={{ marginTop: "50px" }}>
      <Typography variant="h3" align="center" gutterBottom>
        Concept Bottleneck Layer GUI
      </Typography>
      <Box display="flex" justifyContent="space-between" alignItems="center">
        {/* Train Section */}
        <Box textAlign="center">
          <Paper
            elevation={3}
            style={{
              padding: "20px",
              width: "350px",
              height: "250px",
            }}
          >
            <Typography variant="h5" gutterBottom>
              Train Model
            </Typography>
            <Button
              variant="contained"
              color="primary"
              onClick={handleTrainClick}
              disabled={isTraining}
              style={{ fontSize: "16px", padding: "10px 20px", marginTop: "50px" }}
            >
              {isTraining ? "Training..." : "Train"}
            </Button>
          </Paper>
        </Box>

        {/* Test Section */}
        <Box textAlign="center">
          <Paper
            elevation={3}
            style={{
              padding: "20px",
              width: "350px",
              height: "250px",
            }}
          >
            <Typography variant="h5" gutterBottom>
              Classify Input
            </Typography>
            <form onSubmit={handleTestSubmit}>
              <TextField
                label="Enter Text"
                variant="outlined"
                fullWidth
                value={inputText}
                onChange={(e) => setInputText(e.target.value)}
                style={{ marginBottom: "20px" }}
              />
              <Button
                type="submit"
                variant="contained"
                color="secondary"
                style={{ fontSize: "16px", padding: "10px 20px" }}
              >
                Classify
              </Button>
            </form>
          </Paper>
        </Box>
      </Box>

      {/* Classification Result */}
      {classification && (
        <Box textAlign="center" style={{ marginTop: "30px" }}>
          <Typography variant="h6">
            Classification Result: <strong>{classification}</strong>
          </Typography>
        </Box>
      )}

      {/* Concept Activation Bar Chart */}
      {chartData && (
        <Box textAlign="center" style={{ marginTop: "30px" }}>
          <Typography variant="h5" gutterBottom>
            Concept Activations
          </Typography>
          <Paper elevation={3} style={{ padding: "20px" }}>
            <div style={{ height: "400px", width: "600px", margin: "0 auto" }}>
              <Bar
                key={Math.random()}
                data={{
                  labels: Object.keys(chartData),
                  datasets: [
                    {
                      label: "Concept Activation",
                      data: Object.values(chartData),
                      backgroundColor: "rgba(75,192,192,0.6)",
                    },
                  ],
                }}
                options={{
                  responsive: true,
                  maintainAspectRatio: false,
                }}
              />
            </div>
          </Paper>
        </Box>
      )}
    </Container>
  );
}

export default App;
